style.css:
@-moz-document domain("filelist.io") {
html {
       background: url('https://i.imgur.com/B1oJnLY.png') no-repeat center center fixed;
       -webkit-background-size: cover;
       -moz-background-size: cover;
       -o-background-size: cover;
       background-size: cover;
   }
   body {
       background: none;
   }
   a {
       color: #555555;
   }
         
   .logo {
 display: block;
 -moz-box-sizing: border-box;
 box-sizing: border-box;
 background: url(https://i.imgur.com/oir2tx1.png) no-repeat;
 width: 180px; /* Width of new image */
 height: 236px; /* Height of new image */
 padding-left: 180px; /* Equal to width of new image */
}
             
   .wrapper {
       background: none;
   }
   .mainheader {
       background: none;
   }
   .nblock-content a {
       color: #555555;
   }
   #navigation {
       background-color: #1e1e1e;
       border: 1px solid #232323;
       box-shadow: rgba(0, 0, 0, 0.4) 0px 2px 4px, rgba(0, 0, 0, 0.3) 0px 7px 13px -3px, rgba(0, 0, 0, 0.2) 0px -3px 0px inset;
       padding-top: 10px;
       padding-bottom: 10px;
   }
   #navigation li a {
       color: #555555!important;
       text-shadow: 1px 1px 1px #111;
   }
   #navigation li a:hover {
       color: #555555!important;
       text-shadow: 1px 1px 1px #111;
   }
   .btn {
       align-items: center!important;
       appearance: none!important;
       background-image: radial-gradient(100% 100% at 100% 0, #1e1e1e 0, #1e1e1e 100%)!important;
       border: 0!important;
       border-radius: 6px!important;
       box-shadow: rgba(0, 0, 0, 0.4) 0px 2px 4px, rgba(0, 0, 0, 0.3) 0px 7px 13px -3px, rgba(0, 0, 0, 0.2) 0px -3px 0px inset;
       box-sizing: border-box!important;
       color: #ffffff!important;
       cursor: pointer!important;
       display: inline-flex!important;
       height: 38px!important;
       justify-content: center!important;
       line-height: 1!important;
       list-style: none!important;
       overflow: hidden!important;
       padding-left: 5px!important;
       padding-right: 5px!important;
       position: relative!important;
       text-align: center!important;
       text-decoration: none!important;
       transition: box-shadow .15s, transform .15s!important;
       user-select: none!important;
       -webkit-user-select: none!important;
       touch-action: manipulation!important;
       white-space: nowrap!important;
       will-change: box-shadow, transform!important;
       font-size: 12px!important;
   }
   .btn:focus {
   }
   .btn:hover {
       transform: translateY(-2px)!important;
   }
   .btn:active {
       box-shadow: #3c4fe0 0 3px 7px inset!important;
       transform: translateY(2px)!important;
   }
   .torrenttable a {
       color: #555555!important;
       text-shadow: 1px 1px 1px #111;
   }
   .cblock-innercontent table form {
       padding: 10px 10px 10px 10px!important;
   }
   .noborder input, select {
       background: #212121;
       border: 1px solid #1c1c1c;
       padding: 10px 1px 10px 10px;
       color: #fff;
   }
   .noborder input:hover, select:hover {
       background: #212121;
       border: 1px solid #1c1c1c;
       padding: 10px 1px 10px 10px;
       color: #fff;
   }
   .logo {
       width: 400px;
       height: 180px;
       position: relative;
       top: -10px;
       left: 80px;
   }
   .statusbar {
       border: 1px solid #232323;
       box-shadow: rgba(0, 0, 0, 0.4) 0px 2px 4px, rgba(0, 0, 0, 0.3) 0px 7px 13px -3px, rgba(0, 0, 0, 0.2) 0px -3px 0px inset;
       background-color: #1e1e1e;
   }
   .statusbar a {
       color: #555;
   }
   #container a {
       color: #555555;
   }
   .cblock, .cblockcontent {
       border-radius: 3px!important;
   }
   .cblock-top, .cblock-bottom {
       display: none;
   }
   .cblock-content {
       border-left: 4px solid #1c1c1c;
       border-right: 4px solid #1c1c1c;
       border-top: 4px solid #1c1c1c;
       padding: 10px;
   }
   .cblock-innercontent {
       padding: 10px;
   }
   .cblock-headerleft, .cblock-header, .cblock-headerright {
       position: relative;
       bottom: 10px;
   }
   .cblock-content, .cblock-innercontent {
       background: rgba(19, 19, 19, 1);
   }
   .nblock-content {
       border: 1px solid #333;
       background: #222;
       box-shadow: rgba(0, 0, 0, 0.4) 0px 2px 4px, rgba(0, 0, 0, 0.3) 0px 7px 13px -3px, rgba(0, 0, 0, 0.2) 0px -3px 0px inset;
   }
   .sblock-content {
       background-color: #131313;
       border: 1px solid #252525;
       box-shadow: rgba(0, 0, 0, 0.4) 0px 2px 4px, rgba(0, 0, 0, 0.3) 0px 7px 13px -3px, rgba(0, 0, 0, 0.2) 0px -3px 0px inset;
   }
   .colhead {
       background-color: #131313;
       border: 1px solid #252525;
   }
   .nblock-headerleft, .nblock-header, .nblock-headerright {
      background-color: transparent;    
   }
   .sblock-headerleft, .sblock-header, .sblock-headerright {
       background-color: transparent;
   }
   .cblock-headerleft, .cblock-header, .cblock-headerright {
       background-color: transparent;
   }
}
